  ('Harry Potter and the Chamber of Secrets', '', 'J. K. Rowling', 'At 4 Privet Drive, the Dursley family is arguing. Vernon Dursley bellows at his nephew Harry Potter because Harrys pet owl, Hedwig, is noisy. Dudley Dursley, Vernons spoiled and obese son, clamors for more bacon. When Dudley demands the frying pan, Harry mutters, "You ve forgotten the magic word," and the family erupts into chaos.', Now(), Now()),
